async def timer_blankx(e):
    if e.fwd_from:
        return
    e = await edit_or_reply(e, "cas")
    txt = (
        e.text[10:]
        + "\n\n`Tesla Wireless Charging (beta) Dimulai..\nJenis perangkat: Hidungmu 1100\nJumlah baterai:` "
    )
    j = 10
    k = j
